import React, {FC} from 'react';
import './styles.scss';
import { handleAction } from 'redux-actions';

interface IProps {};

export default function RegistrationSuccesful() {

  handleAction()
  return(
<div className="container-success">
  <h1>Congratulations!! your registration was successful.</h1>
  <p>Welcome to TransportWise.</p>
  <br />
  <button type="submit" className="btnAll">Register</button>
</div>
);
}
